import {
  createStore as reduxCreateStore,
  combineReducers,
} from 'redux';

import {UsersReducer} from '../users/reducer';

export default function createStore() {
  return reduxCreateStore(
    combineReducers({
      users: UsersReducer
    })
  )
}
